import React, { Component } from 'react';
import axios from 'axios';
import { format } from 'timeago.js';
import { Link } from 'react-router-dom';

export default class NotesList extends Component {
    state = {
        notes: [],
        isLoading: true,
        error: null,
        showModal: false,
        noteToDelete: null // ID of the note to delete
    }

    componentDidMount() {
        this.getNotes();
    }

    async getNotes() {
        try {
            const res = await axios.get('http://localhost:4000/api/notes');
            this.setState({ notes: res.data, isLoading: false });
        } catch (error) {
            this.setState({ error: 'Failed to load notes', isLoading: false });
        }
    }

    openModal = (id) => {
        this.setState({ showModal: true, noteToDelete: id });
    }

    closeModal = () => {
        this.setState({ showModal: false, noteToDelete: null });
    }

    deleteNote = async () => {
        try {
            await axios.delete(`http://localhost:4000/api/notes/${this.state.noteToDelete}`);
            this.closeModal();
            this.getNotes();
        } catch (error) {
            console.error('Failed to delete the note', error);
            this.setState({ error: 'Failed to delete the note' });
        }
    }

    render() {
        const { isLoading, error, notes, showModal } = this.state;

        if (isLoading) {
            return <p>Loading notes...</p>;
        }

        if (error) {
            return <p>{error}</p>;
        }

        return (
            <div className="row">
                {notes.map(note => (
                    <div className="col-md-4 p-2" key={note._id}>
                        <div className="card">
                            <div className="card-header d-flex justify-content-between">
                                <h5>{note.title}</h5>
                                <Link to={`/edit/${note._id}`} className="btn btn-secondary">
                                    Edit
                                </Link>
                            </div>
                            <div className="card-body">
                                <p>{note.content}</p>
                                <p>{note.author}</p>
                                <p>{format(note.date)}</p>
                            </div>
                            <div className="card-footer">
                                <button className="btn btn-danger" onClick={() => this.openModal(note._id)}>
                                    Delete
                                </button>
                            </div>
                        </div>
                    </div>
                ))}

                {/* Bootstrap Modal */}
                {showModal && (
                    <div className="modal show" style={{ display: 'block' }} tabIndex="-1">
                        <div className="modal-dialog">
                            <div className="modal-content">
                                <div className="modal-header">
                                    <h5 className="modal-title">Confirm Deletion</h5>
                                    <button type="button" className="close" onClick={this.closeModal}>
                                        <span aria-hidden="true">&times;</span>
                                    </button>
                                </div>
                                <div className="modal-body">
                                    <p>Are you sure you want to delete this note?</p>
                                </div>
                                <div className="modal-footer">
                                    <button type="button" className="btn btn-secondary" onClick={this.closeModal}>
                                        Cancel
                                    </button>
                                    <button type="button" className="btn btn-danger" onClick={this.deleteNote}>
                                        Delete
                                    </button>
                                </div>
                            </div>
                        </div>
                        <div className="modal-backdrop show"></div>
                    </div>
                )}
            </div>
        );
    }
}
